import React from 'react';

function Footer() {
    return(
        <section>
            <p>This is the footer</p>
            <a href= "https://github.com/AdmiralCrunchy" >
                <img alt="GitHub Logo" src= "https://cdn-icons-png.flaticon.com/512/25/25231.png" width="256px" height="256px"/>
            </a>
        </section>
    )
}

export default Footer;
